import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import UserIcon from '@mui/icons-material/AccountCircle';
import SearchIcon from '@mui/icons-material/Search';
import LogoImage from "../Assets/logo-white.png";
import Sidebar from "../Sidebar/Sidebar";
import Submission from "../Submission/Submission"; // Import the Submission component
import "./Submission.css";

const Dashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false); 
  const navigate = useNavigate();

  const navigateToProfile = () => {
    navigate('/login');
  };

  const navigateToDashboard = () => {
    navigate('/dashboard');
  };

  const handleSearch = (event) => {
    console.log("Searching for:", event.target.value);
  };

  return (
    <div className="Dashboard">
      {/* Navbar section */}
      <nav className="navbar">
        <button className="menu-btn" onClick={() => setSidebarOpen(!sidebarOpen)}>
          <MenuIcon />
        </button>

        <button className="logo-btn" onClick={navigateToDashboard}>
          <img src={LogoImage} alt="Logo" className="logo" />
        </button>

        <div className="search-bar">
          <input type="text" placeholder="Search..." onChange={handleSearch} />
          <SearchIcon />
        </div>

        <button className="profile-btn" onClick={navigateToProfile}>
          <UserIcon className="profile-icon" style={{ fontSize: 45 }} />
        </button>
      </nav>

      {/* Sidebar section */}
      <Sidebar isOpen={sidebarOpen} />

      {/* Main content section */}
      <main className={`main-content ${sidebarOpen ? "shifted" : ""}`}>
        <Submission /> {/* Render the Submission component here */}
      </main>
    </div>
  );
};

export default Dashboard;
